import styled from 'styled-components';


const Background = (color) =>{ styled.div`
background: ${color};
border-radius: 50%;
width: 1080px;
height: 1080px;
border: 5px solid black;
margin-top: 5%;
position: absolute;
display: flex;
justify-content: center;
`
}

export const CablesArea = styled.div`
height: 370px;
width: 100px;
background: white;
`

export const Potentiometer = styled.div`
background: white;
border-radius: 50%;
width: 400px;
height: 400px;
margin-top: 340px;
position: absolute;
`

export default Background();
